import class_dialogs from "./Dialogs.module.css";

const Dialogs = (props) => {
  return (
    <div className={class_dialogs.dialogs}>
      <div className={class_dialogs.dialog_item}>
        <div className={class_dialogs.dialog}>Ekaterina</div>
        <div className="dialog">Yulia</div>
        <div className="dialog">Nadiay</div>
        <div className="dialog">Viacheslav</div>
        <div className="dialog">Oksana</div>
        <div className="dialog">Evgeniy</div>
        <div className="dialog">Aleksandr</div>
        <div className="dialog">Ivan</div>
      </div>
      <div className="messages"></div>Dialogs
    </div>
  );
};

export default Dialogs;
